import React from "react";

const SelectSearch = () => {
  return (
    <div className="selectSearch-container">
      <ul>
        <li>Used Cars</li>
        <li>Any Makes</li>
        <li>Any Models</li>
        <li>All Prices</li>
      </ul>
    </div>
  );
};

export default SelectSearch;
